import java.util.Scanner;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String line = "";
		Scanner scan = new Scanner(System.in);
		readInput(scan);
	}

	public static void readInput(Scanner scan){
		while (scan.hasNextLine()) {
			line = scan.nextLine();
			while(line.equals("")){
				line = scan.nextLine();
			}
		}
		scan.close();
	}
}
